import './App.css';

import { BrowerRouter, Route, Switch } from 'react-router-dom'

import Home from './Components/Home'

function App() {
  return (
    <div>
      <BrowerRouter>
        <Switch>
          <Route path="/" component={Home} />
        </Switch>
      </BrowerRouter>
    </div>
  );
}

export default App;
